    <div >
    <Card
      img="https://images.unsplash.com/photo-1448932223592-d1fc686e76ea"
      title="Computadores"
    />
   </div>
);
}

function Card(props) {
  return(
    <div> 
     <h2 class="text-center m-4">NUESTROS PRODUCTOS</h2>
